# Chishma, Balyklykulsky Selsoviet, Aurgazinsky District, Republic of Bashkortostan

}}
Chishma (; , Şişmä) is a rural locality (a village) in Balyklykulsky Selsoviet, Aurgazinsky District, Bashkortostan, Russia. The population was 65 as of 2010.
Geography
It is located 12&nbsp;km from Tolbazy and 3&nbsp;km from Balyklykul.
